        const json = await response.json();

        console.log(json);

        if (json.user) {
            console.log(json.user);
            saveToken(json.jwt);
            saveUser(json.user);
        }

        if (json.error) {
            <h1>incorrect username or password</h1>
        }

    } catch (error) {
        <h1>error error error</h1>
    }


    return (
        <Form onSubmit={submitForm}>
            <h1>Please register to login</h1>
            <input className="form-control" placeholder="Username" required 
                onChange={event => setUsername(event.target.value)}
            />
            <input type="email" className="form-control" placeholder="Email" required 
                onChange={event => setEmail(event.target.value)}
            />
            <input type="password" className="form-control" placeholder="Password" required 
                onChange={event => setPassword(event.target.value)}
            />
            <Button className="btn btn-outline-dark" type="submit">Send to register</Button>
        </Form>
    );
}

export default setRegister;
